Typically, one trains a model on some dataset. Burn provides a library of very useful dataset sources and transformations. In particular, there are Hugging Face dataset utilities that allow to download and store data from Hugging Face into an SQLite database for extremely efficient data streaming and storage. For this guide, we will use the MNIST dataset provided by Hugging Face. To iterate over a dataset efficiently, we will define a struct which will implement the Batcher trait. The goal of a batcher is to map individual dataset items into a batched tensor that can be used as input to our previously defined model. use burn::{ data::{dataloader::batcher::Batcher, dataset::source::huggingface::MNISTItem}, tensor::{backend::Backend, Data, ElementConversion, Int, Tensor},
}; pub struct MNISTBatcher<B: Backend> { device: B::Device,
} impl<B: Backend> MNISTBatcher<B> { pub fn new(device: B::Device) -> Self { Self { device } }
} This codeblock defines a batcher struct with the device in which the tensor should be sent before being passed to the model. Note that the device is an associative type of the Backend trait since not all backends expose the same devices. As an example, the Libtorch-based backend exposes Cuda(gpu_index), Cpu, Vulkan and Metal devices, while the ndarray backend only exposes the Cpu device. Next, we need to actually implement the batching logic. #[derive(Clone, Debug)]
pub struct MNISTBatch<B: Backend> { pub images: Tensor<B, 3>, pub targets: Tensor<B, 1, Int>,
} impl<B: Backend> Batcher<MNISTItem, MNISTBatch<B>> for MNISTBatcher<B> { fn batch(&self, items: Vec<MNISTItem>) -> MNISTBatch<B> { let images = items .iter() .map(|item| Data::<f32, 2>::from(item.image)) .map(|data| Tensor::<B, 2>::from_data(data.convert())) .map(|tensor| tensor.reshape([1, 28, 28])) // Normalize: make between [0,1] and make the mean=0 and std=1 // values mean=0.1307,std=0.3081 are from the PyTorch MNIST example // https://github.com/pytorch/examples/blob/54f4572509891883a947411fd7239237dd2a39c3/mnist/main.py#L122 .map(|tensor| ((tensor / 255) - 0.1307) / 0.3081) .collect(); let targets = items .iter() .map(|item| Tensor::<B, 1, Int>::from_data(Data::from([(item.label as i64).elem()]))) .collect(); let images = Tensor::cat(images, 0).to_device(&self.device); let targets = Tensor::cat(targets, 0).to_device(&self.device); MNISTBatch { images, targets } }
} In the previous example, we implement the Batcher trait with a list of MNISTItem as input and a single MNISTBatch as output. The batch contains the images in the form of a 3D tensor, along with a targets tensor that contains the indexes of the correct digit class. The first step is to parse the image array into a Data struct. Burn provides the Data struct to encapsulate tensor storage information without being specific for a backend. When creating a tensor from data, we often need to convert the data precision to the current backend in use. This can be done with the .convert() method. While importing the burn::tensor::ElementConversion trait, you can call .elem() on a specific number to convert it to the current backend element type in use.

